import React from 'react';
import './Slider.css';

const Slider = () => {
  return (
    <div>
      <div id="slider">
<figure>
<img src="images/lab.jpg"/>
<img src="images/1.jpg"/>
<img src="images/universal.jpg"/>
<img src="images/8.jpg"/>
<img src="images/2.jpg"/>
</figure>
</div>

    </div>
  );
}

export default Slider;
